DROP TABLE IF EXISTS `aftersales`;
CREATE TABLE `aftersales`  (
  `aftersale_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT,
  `aftersale_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '申请类型：1、退货退款，2、换货，3、维修，4、其它，5，仅退款',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态：1、正在审核处理，2、售后审核通过,待处理，3、售后审核未通过，4、售后要求寄回，5、快递已寄回，6、已完成7.已取消',
  `pics` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户凭证',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '描述',
  `reply` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '回复',
  `add_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '添加时间',
  `tracking_no` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '物流编号',
  `logistics_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '物流公司',
  `return_address` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '退款地址和联系电话。',
  `aftersale_reason` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后原因',
  `aftersales_sn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后编号',
  `order_id` int(11) NULL DEFAULT NULL COMMENT '订单id',
  `user_id` int(11) NULL DEFAULT NULL COMMENT '用户id',
  `refund_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '可退款金额',
  `shop_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `audit_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '审核时间',
  `deal_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '处理时间',
  `final_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '完结时间',
  `return_goods_tip` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '售后退货提示',
  PRIMARY KEY (`aftersale_id`) USING BTREE,
  UNIQUE INDEX `return_id`(`aftersale_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE,
  INDEX `shop_id`(`shop_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '售后申请表' ROW_FORMAT = DYNAMIC;

