-- ----------------------------
-- Table structure for brand
-- ----------------------------
DROP TABLE IF EXISTS `brand`;
CREATE TABLE `brand`  (
  `brand_id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增id号',
  `brand_name` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '品牌名称',
  `brand_logo` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '上传的该公司Logo图片',
  `brand_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '品牌描述',
  `site_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '否 /	品牌的网址',
  `sort_order` tinyint(3) UNSIGNED NOT NULL DEFAULT 50 COMMENT '品牌在前台页面的显示顺序,数字越大越靠后',
  `is_show` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '该品牌是否显示;0否1显示',
  `brand_type` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '品牌分类',
  `brand_is_hot` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否热销品牌:0,否;1,是',
  `first_word` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '首字母',
  `is_store_brand` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '(已废弃)',
  `check_status` smallint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '审核状态:0,待审核;1,审核通过;2,不通过',
  `brand_en_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '品牌英文名',
  PRIMARY KEY (`brand_id`) USING BTREE,
  INDEX `is_show`(`is_show`) USING BTREE,
  INDEX `first_word`(`first_word`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 193 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品品牌表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of brand
-- ----------------------------

-- ----------------------------
-- Table structure for cart
-- ----------------------------
DROP TABLE IF EXISTS `cart`;
CREATE TABLE `cart`  (
  `cart_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增id号',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户登录ID;取自session',
  `product_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品id',
  `product_sn` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '货号',
  `pic_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '商品缩略图',
  `market_price` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '市场价',
  `original_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '添加时的价格',
  `quantity` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '数量',
  `sku_id` mediumint(8) UNSIGNED NULL DEFAULT 0 COMMENT '规格ID',
  `sku_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '【JSON】sku信息[{sku_id,sku_value,sku_name}]',
  `product_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品类型，1：实体，2：虚拟',
  `is_checked` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否选中',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `type` smallint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '类型：1：普通购物车商品，2：拼团,3积分兑换4赠品，5砍一砍 6 虚拟 7 付费商品 8 卡密商品',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '购物车商品更新时间',
  `salesman_id` int(11) NOT NULL DEFAULT 0 COMMENT '分销员',
  `extra_sku_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '【JSON】附加属性信息[{attr_id,attr_value,attr_name}]',
  PRIMARY KEY (`cart_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `product_id`(`product_id`) USING BTREE,
  INDEX `sku_id`(`sku_id`) USING BTREE,
  INDEX `store_id`(`shop_id`) USING BTREE,
  INDEX `is_checked`(`is_checked`) USING BTREE,
  INDEX `type`(`type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '购物车购物信息记录表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of cart
-- ----------------------------

-- ----------------------------
-- Table structure for category
-- ----------------------------
DROP TABLE IF EXISTS `category`;
CREATE TABLE `category`  (
  `category_id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增id号',
  `category_name` varchar(90) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类名称',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类的关键字,可能是为了搜索',
  `category_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类描述',
  `parent_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '该分类的父类ID,取值于该表的cat_id字段',
  `sort_order` smallint(4) UNSIGNED NOT NULL DEFAULT 50 COMMENT '该分类在页面显示的顺序,数字越大顺序越靠后,同数字,id在前的先显示',
  `measure_unit` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '该分类的计量单位',
  `is_show` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否在前台页面显示 1显示; 0不显示',
  `seo_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `short_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类短名',
  `category_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类图片',
  `category_ico` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类图标',
  `is_hot` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否热门',
  `search_keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '搜索关键字',
  PRIMARY KEY (`category_id`) USING BTREE,
  INDEX `parent_id`(`parent_id`) USING BTREE,
  INDEX `is_show`(`is_show`) USING BTREE,
  INDEX `sort_order`(`sort_order`) USING BTREE,
  INDEX `is_hot`(`is_hot`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 768 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品分类表，记录商品分类信息' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of category
-- ----------------------------

