  `biz_code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '业务编码',
  `biz_val` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '业务值',
  `create_time` bigint(20) NULL DEFAULT 0 COMMENT '创建时间',
  `create_by_id` bigint(20) NULL DEFAULT 0 COMMENT '创建人主键',
  `create_by_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '创建人名称',
  `update_time` bigint(20) NULL DEFAULT 0 COMMENT '更新时间',
  `update_by_id` bigint(20) NULL DEFAULT 0 COMMENT '编辑人主键',
  `update_by_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '更新人名称',
  `is_del` tinyint(4) NULL DEFAULT 0 COMMENT '是否删除；0-否，1-是',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 219 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '系统配置表' ROW_FORMAT = Dynamic;

