-- ----------------------------
-- Table structure for im_servant
-- ----------------------------
DROP TABLE IF EXISTS `im_servant`;
CREATE TABLE `im_servant`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `servant_id` int(11) NULL DEFAULT NULL COMMENT '客服id',
  `last_update_time` int(11) NULL DEFAULT NULL COMMENT '最后更新时间',
  `add_time` int(11) NULL DEFAULT NULL COMMENT '进入时间',
  `status` tinyint(2) NULL DEFAULT 1 COMMENT '状态1在线2忙3离开',
  `shop_id` int(11) NULL DEFAULT 0 COMMENT '所属店铺',
  `conversation_num` int(11) NULL DEFAULT 0 COMMENT '当前进行的会话数量',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of im_servant
-- ----------------------------

-- ----------------------------
-- Table structure for keywords
-- ----------------------------
DROP TABLE IF EXISTS `keywords`;
CREATE TABLE `keywords`  (
  `date` date NOT NULL  COMMENT '搜索日期',
  `searchengine` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '搜索引擎，默认是ecshop',
  `keyword` varchar(90) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '搜索关键字，即用户填写的搜索内容',
  `count` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '搜索次数，按天累加',
  PRIMARY KEY (`date`, `searchengine`, `keyword`) USING BTREE,
  INDEX `keyword`(`keyword`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '关键词' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of keywords
-- ----------------------------

-- ----------------------------
-- Table structure for locales
-- ----------------------------
DROP TABLE IF EXISTS `locales`;
CREATE TABLE `locales`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `locale_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '语言地区代码，如 \'en_US\'',
  `language` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '语言，如 \'English、中文、繁體中文\'',
  `flag_picture` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '国旗图片',
  `last_updated` int(11) NULL DEFAULT 0 COMMENT '最后更新时间',
  `is_enabled` tinyint(2) NULL DEFAULT 1 COMMENT '是否启用1启用0禁用',
  `is_default` tinyint(2) UNSIGNED NULL DEFAULT 0 COMMENT '是否默认：1 是 0 否',
  `currency_id` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '货币id',
  `sort` int(11) NULL DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '语言地区维护表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of locales
