-- Table structure for logistics_api_log
-- ----------------------------
DROP TABLE IF EXISTS `logistics_api_log`;
CREATE TABLE `logistics_api_log`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NULL DEFAULT 0 COMMENT '商城订单号',
  `order_code` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '快递订单编号',
  `logistic_code` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '物流单号',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '发起时间',
  `print_template` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '返回模板',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE,
  INDEX `logistic_code`(`logistic_code`) USING BTREE,
  INDEX `order_code`(`order_code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '快递接口调用日志' ROW_FORMAT = DYNAMIC;

