-- ----------------------------
-- Records of logistics_company
-- ----------------------------

-- ----------------------------
-- Table structure for mail_log
-- ----------------------------
DROP TABLE IF EXISTS `mail_log`;
CREATE TABLE `mail_log`  (
  `mail_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `email` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '邮箱地址',
  `send_time` int(11) UNSIGNED NOT NULL COMMENT '发送时间',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '内容',
  PRIMARY KEY (`mail_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `email`(`email`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '邮件发送日志表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of mail_log
-- ----------------------------

-- ----------------------------
-- Table structure for mail_templates
-- ----------------------------
DROP TABLE IF EXISTS `mail_templates`;
CREATE TABLE `mail_templates`  (
  `template_id` tinyint(1) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '邮件模板自增id',
  `template_code` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '模板字符串名称，主要用于插件言语包时匹配语言包文件等用途',
  `is_html` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '邮件是否是html格式；0，否；1，是',
  `template_subject` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '该邮件模板的邮件主题',
  `template_content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '邮件模板的内容',
  `last_modify` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最后一次修改模板的时间',
  `last_send` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最近一次发送的时间',
  `type` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '该邮件模板的邮件类型；共2个类型；magazine，杂志订阅；template，关注订阅',
  PRIMARY KEY (`template_id`) USING BTREE,
  UNIQUE INDEX `template_code`(`template_code`) USING BTREE,
  INDEX `type`(`type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 18 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '各种邮件的模板配置模板' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of mail_templates
-- ----------------------------

-- ----------------------------
-- Table structure for merchant
-- ----------------------------
DROP TABLE IF EXISTS `merchant`;
CREATE TABLE `merchant`  (
  `merchant_id` int(11) NOT NULL AUTO_INCREMENT,
  `merchant_apply_id` int(11) NULL DEFAULT 0 COMMENT '入驻申请id',
  `user_id` int(11) NULL DEFAULT 0 COMMENT '入驻申请用户id',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '商户创建时间',
  `base_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '基础数据json',
  `shop_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '店铺数据json',
  `merchant_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商户数据json',
  `status` tinyint(2) NULL DEFAULT 1 COMMENT '状态1正常2取消资格',
  `type` tinyint(1) NULL DEFAULT 1 COMMENT '类型1个人2企业',
  `company_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '企业名称',
  `corporate_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '申请主体信息',
  `settlement_cycle` int(10) NULL DEFAULT 15 COMMENT '结算周期单位天',
  PRIMARY KEY (`merchant_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商家表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of merchant
-- ----------------------------

-- ----------------------------
-- Table structure for merchant_account
-- ----------------------------
DROP TABLE IF EXISTS `merchant_account`;
CREATE TABLE `merchant_account`  (
  `account_id` int(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '账号ID',
  `merchant_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商户id',
  `account_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '提现账号类型，1：银行卡，2：支付宝，3：微信',
  `account_name` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '姓名',
  `account_no` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '银行卡号或账号',
  `bank_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行名称',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '添加时间',
  `bank_branch` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '分行名称',
  `shop_id` int(11) NULL DEFAULT NULL COMMENT '店铺ID',
  PRIMARY KEY (`account_id`) USING BTREE,
  INDEX `account_type`(`account_type`) USING BTREE,
  INDEX `merchant_id`(`merchant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商家账户表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of merchant_account
-- ----------------------------

-- ----------------------------
-- Table structure for merchant_apply
-- ----------------------------
DROP TABLE IF EXISTS `merchant_apply`;
CREATE TABLE `merchant_apply`  (
  `merchant_apply_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NULL DEFAULT NULL COMMENT '用户id',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '添加时间',
  `shop_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '店铺名称',
  `status` tinyint(2) NULL DEFAULT 1 COMMENT '1待审核10审核通过20审核未通过',
  `type` tinyint(2) NULL DEFAULT 1 COMMENT '1个人2企业',
  `contact_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '联系人名称',
  `contact_mobile` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '联系人手机',
  `audit_time` int(11) NULL DEFAULT 0 COMMENT '审核时间',
  `shop_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '申请资料shop信息json',
  `base_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '申请资料基本信息json',
  `merchant_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '申请资料的商户信息json',
  `company_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '企业名称',
  `corporate_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '申请主体信息',
  `audit_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '审核备注',
  PRIMARY KEY (`merchant_apply_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商家入驻表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of merchant_apply
-- ----------------------------

-- ----------------------------
-- Table structure for merchant_user
-- ----------------------------
DROP TABLE IF EXISTS `merchant_user`;
CREATE TABLE `merchant_user`  (
  `merchant_user_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NULL DEFAULT 0 COMMENT '前台用户id',
  `admin_user_id` int(11) NULL DEFAULT 0 COMMENT '后台用户id',
  `merchant_id` int(11) NULL DEFAULT 0 COMMENT '商户id',
  `is_admin` tinyint(2) NULL DEFAULT 0 COMMENT '是否管理员1是0不是',
  PRIMARY KEY (`merchant_user_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `admin_user_id`(`admin_user_id`) USING BTREE,
  INDEX `merchant_id`(`merchant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商户用户表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of merchant_user
-- ----------------------------

-- ----------------------------
-- Table structure for message_template
-- ----------------------------
DROP TABLE IF EXISTS `message_template`;
CREATE TABLE `message_template`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `message_id` int(11) NULL DEFAULT 0 COMMENT '消息类型ID',
  `type` tinyint(1) NULL DEFAULT 0 COMMENT '消息类型 1模板消息 2订阅消息 3短信 4站内信 5app 6钉钉',
  `template_name` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '模板名称',
  `to_userid` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '发送对象(暂只用于钉钉)',
  `template_id` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '模板ID',
  `template_num` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '模板编号',
  `content` varchar(800) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '通知内容',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `message_id`(`message_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 26 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '模板消息表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of message_template
-- ----------------------------

-- ----------------------------
-- Table structure for message_type
-- ----------------------------
DROP TABLE IF EXISTS `message_type`;
CREATE TABLE `message_type`  (
  `message_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '通知类型',
  `describe` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '通知描述',
  `send_type` tinyint(1) NULL DEFAULT 1 COMMENT '发送类型  1会员 2商家',
  `is_wechat` tinyint(1) NULL DEFAULT 0 COMMENT '是否支持微信公众号',
  `is_mini_program` tinyint(1) NULL DEFAULT 0 COMMENT '是否支持小程序',
  `is_message` tinyint(1) NULL DEFAULT 0 COMMENT '是否支持站内信',
  `is_msg` tinyint(1) NULL DEFAULT 0 COMMENT '是否支持短信',
  `is_app` tinyint(1) NULL DEFAULT 0 COMMENT '是否支付app',
  `is_ding` tinyint(1) NULL DEFAULT 0 COMMENT '是否支持钉钉',
  `add_time` int(1) NULL DEFAULT 0 COMMENT '添加时间',
  PRIMARY KEY (`message_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 12 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '消息类型' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of message_type
-- ----------------------------

-- ----------------------------
-- Table structure for mobile_cat_nav
-- ----------------------------
DROP TABLE IF EXISTS `mobile_cat_nav`;
CREATE TABLE `mobile_cat_nav`  (
  `mobile_cat_nav_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `category_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '选择分类',
  `cat_color` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类颜色（颜色选择器）',
  `child_cat_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '[JSON]推荐子分类（多选）',
  `brand_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '推荐品牌',
  `is_show` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否显示：1显示，0不显示',
  `img_url` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '分类banner字符串，英文符号\'｜\' 分割',
  `sort_order` smallint(4) UNSIGNED NOT NULL DEFAULT 50 COMMENT '在页面显示的顺序,数字越大顺序越靠后,同数字,id在前的先显示',
  `cat_name_alias` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '自定义分类名',
  PRIMARY KEY (`mobile_cat_nav_id`) USING BTREE,
  INDEX `category_id`(`category_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '手机分类' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of mobile_cat_nav
-- ----------------------------

-- ----------------------------
-- Table structure for order
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order`  (
  `order_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `order_sn` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '订单号,唯一',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id,同users的user_id',
  `parent_order_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '父订单id',
  `parent_order_sn` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '父订单号',
  `order_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单的状态：0 待确定，待支付 1 已确定，待发货 2处理中，已发货 3 已取消 4 无效 5 已完成',
  `shipping_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品配送情况;0未发货,1已发货,2已收货,4退货',
  `pay_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付状态：0未支付 1支付中 2已支付 3退款中 4 已退款',
  `add_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单生成时间',
  `consignee` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人的姓名,用户页面填写,默认取值表user_address',
  `address` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '详细地址',
  `region_ids` tinytext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【JSON】地址id，number[]',
  `region_names` tinytext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【JSON】地址name, string[]',
  `address_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '【JSON】收货人信息',
  `mobile` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人的手机',
  `email` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人的Email',
  `buyer_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '买家备注',
  `admin_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商家备注，仅商家可见',
  `shipping_method` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '发货方式：1：物流，2：商家自提，3：无需配送',
  `logistics_id` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '快递公司id/为0则表示商家配送或无需配送',
  `logistics_name` varchar(120) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '具体物流公司名称/商家配送/无需配送',
  `shipping_type_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '配送类型id',
  `shipping_type_name` varchar(120) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '配送类型名称',
  `tracking_no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '发货单号',
  `shipping_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单配送时间',
  `received_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单收货时间',
  `pay_type_id` smallint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付类型:1,在线支付（微信、支付等）;2,货到付款（支持先发货，后付款）;3,线下支付',
  `pay_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单支付时间',
  `use_points` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '使用的积分的数量',
  `is_need_commisson` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否需要分佣',
  `distribution_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否已分销分成',
  `referrer_user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '推广人userId',
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除',
  `shop_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `is_store_splited` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否已按店铺拆分:0,否;1,是',
  `comment_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否已评价',
  `total_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '订单总金额（商品总价 + 运费等 - 优惠券 - 各种优惠活动）',
  `paid_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '已支付金额(包含使用余额+线上支付金额+线下支付金额)',
  `unpaid_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '未付款金额（计算方式为：total_amount - paid_amount）',
  `unrefund_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '未退款金额（一般出现在订单取消或修改金额、商品后）',
  `product_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '商品的总金额',
  `coupon_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '使用优惠券金额 ',
  `points_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '使用积分金额',
  `discount_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '参加优惠活动金额，如折扣、满减等',
  `balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '使用余额金额',
  `online_paid_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '线上支付金额（支付宝、微信等）',
  `offline_paid_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '线下支付金额（银行汇款等）',
  `service_fee` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '服务费',
  `shipping_fee` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '配送费用',
  `invoice_fee` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '发票费用',
  `order_extension` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【JSON】记录订单使用的优惠券、优惠活动、不同店铺配送等的具体细节信息',
  `order_source` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '下单来源设备，APP|PC|H5|微信公众号|微信小程序',
  `invoice_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '【JSON】发票信息',
  `out_trade_no` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '订单支付平台单号',
  `is_settlement` tinyint(2) NULL DEFAULT 0 COMMENT '是否结算0未结算1已结算',
  `is_exchange_order` tinyint(1) NULL DEFAULT 0 COMMENT '是否是积分抵扣订单',
  `order_type` tinyint(2) NULL DEFAULT 1 COMMENT '订单类型：1普通订单，3积分订单，2拼团，5砍一砍 6 虚拟订单 7 付费商品订单 8 卡密订单',
  PRIMARY KEY (`order_id`) USING BTREE,
  UNIQUE INDEX `order_sn`(`order_sn`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `order_status`(`order_status`) USING BTREE,
  INDEX `shipping_status`(`shipping_status`) USING BTREE,
  INDEX `pay_status`(`pay_status`) USING BTREE,
  INDEX `shipping_id`(`logistics_id`) USING BTREE,
  INDEX `store_id`(`shop_id`) USING BTREE,
  INDEX `is_del`(`is_del`) USING BTREE,
  INDEX `pay_type_id`(`pay_type_id`) USING BTREE,
  INDEX `add_time`(`add_time`) USING BTREE,
  INDEX `referrer_user_id`(`referrer_user_id`) USING BTREE,
  INDEX `is_need_commisson`(`is_need_commisson`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order
-- ----------------------------

-- ----------------------------
-- Table structure for order_amount_detail
-- ----------------------------
DROP TABLE IF EXISTS `order_amount_detail`;
CREATE TABLE `order_amount_detail`  (
  `order_discount_detail_id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NULL DEFAULT NULL,
  `shop_id` int(11) NULL DEFAULT 0,
  `shipping_fee` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '运费金额',
  `discount_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '除优惠券之外的金额',
  `coupon_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '优惠券金额',
  `time_discount_amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '限时折扣金额',
  PRIMARY KEY (`order_discount_detail_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单店铺金额明细表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_amount_detail
-- ----------------------------

-- ----------------------------
-- Table structure for order_config
-- ----------------------------
DROP TABLE IF EXISTS `order_config`;
CREATE TABLE `order_config`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '编码',
  `data` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '[json]配置数据',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '店铺订单配置表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_config
-- ----------------------------

-- ----------------------------
-- Table structure for order_coupon_detail
-- ----------------------------
DROP TABLE IF EXISTS `order_coupon_detail`;
CREATE TABLE `order_coupon_detail`  (
  `order_coupon_detail_id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NULL DEFAULT NULL,
  `shop_id` int(11) NULL DEFAULT 0,
  `coupon_id` int(11) NULL DEFAULT 0 COMMENT '优惠券id',
  `coupon_fee` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '优惠金额',
  PRIMARY KEY (`order_coupon_detail_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单店铺优惠券表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_coupon_detail
-- ----------------------------

-- ----------------------------
-- Table structure for order_invoice
-- ----------------------------
DROP TABLE IF EXISTS `order_invoice`;
CREATE TABLE `order_invoice`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单发票申请id',
  `user_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员id',
  `order_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单id/父订单id',
  `invoice_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '发票类型：1:普通发票，2:专用发票',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '发票申请状态：0:待处理，1:已开，2:失败/作废',
  `apply_reply` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '申请失败时的回复内容',
  `title_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '抬头：1：个人，2企业',
  `company_code` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '纳税人识别号',
  `company_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '个人/单位名称',
  `company_address` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '单位地址',
  `company_phone` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '单位电话',
  `company_bank` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '开户银行',
  `company_account` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行账号',
  `invoice_content` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '商品明细' COMMENT '发票内容，统一为商品明细',
  `invoice_no` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '发票号码',
  `amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '发票金额',
  `mobile` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邮箱',
  `add_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '申请时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单发票地址' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_invoice
-- ----------------------------

-- ----------------------------
-- Table structure for order_item
-- ----------------------------
DROP TABLE IF EXISTS `order_item`;
CREATE TABLE `order_item`  (
  `item_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单商品信息自增id',
  `order_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单ID',
  `order_sn` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '订单编号',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员ID',
  `price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '商品最终单价',
  `quantity` smallint(5) UNSIGNED NOT NULL DEFAULT 1 COMMENT '商品的购买数量',
  `product_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品ID',
  `product_name` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品的名称',
  `product_sn` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品的唯一货号',
  `pic_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品缩略图',
  `sku_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '规格ID',
  `sku_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【JSON】sku信息[{sku_id,sku_value,sku_name}]',
  `delivery_quantity` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '发货数量',
  `product_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '商品类型，1：实体，2：虚拟，3赠品',
  `is_gift` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否为赠品',
  `shop_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺ID',
  `is_pin` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否拼团',
  `prepay_price` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '预售价格',
  `commission` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '佣金数据',
  `origin_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '商品初始价格',
  `promotion_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '优惠信息',
  `is_seckill` tinyint(2) NULL DEFAULT 0 COMMENT '是否秒杀',
  `extra_sku_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '附加属性',
  `suppliers_id` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '供应商id',
  `card_group_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '卡密商品组名称',
  PRIMARY KEY (`item_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE,
  INDEX `goods_id`(`product_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单的商品信息' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_item
-- ----------------------------

-- ----------------------------
-- Table structure for order_log
-- ----------------------------
DROP TABLE IF EXISTS `order_log`;
CREATE TABLE `order_log`  (
  `log_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '流水号',
  `order_id` int(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '被操作的订单id',
  `order_sn` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `admin_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '操作管理员（后台）',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '操作会员（前台）',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '操作备注',
  `log_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '操作时间',
  `shop_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  PRIMARY KEY (`log_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单操作日志表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_log
-- ----------------------------

-- ----------------------------
-- Table structure for order_split_log
-- ----------------------------
DROP TABLE IF EXISTS `order_split_log`;
CREATE TABLE `order_split_log`  (
  `log_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '拆份订单',
  `parent_order_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '父订单id',
  `order_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '拆分后的订单id',
  `split_time` int(11) UNSIGNED NOT NULL COMMENT '拆分时间',
  `parent_order_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '父订单信息',
  PRIMARY KEY (`log_id`) USING BTREE,
  INDEX `add_time`(`parent_order_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单拆单记录' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of order_split_log
-- ----------------------------

-- ----------------------------
-- Table structure for paylog
-- ----------------------------
DROP TABLE IF EXISTS `paylog`;
CREATE TABLE `paylog`  (
  `paylog_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '支付日志id',
  `pay_sn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付号',
  `pay_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `order_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单id',
  `order_sn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '订单sn',
  `order_amount` decimal(10, 2) UNSIGNED NOT NULL COMMENT '订单金额',
  `order_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单类型0订单1充值',
  `pay_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '支付金额',
  `pay_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付状态，0:待支付，1：已支付，2：支付失败',
  `pay_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付方式code，比如wechat',
  `add_time` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '添加时间',
  `transaction_id` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '交易流水号',
  `notify_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '回调参数',
  `refund_amount` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '退款金额',
  `token_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`paylog_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE,
  INDEX `pay_status`(`pay_status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '支付日志表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of paylog
-- ----------------------------

-- ----------------------------
-- Table structure for paylog_refund
-- ----------------------------
DROP TABLE IF EXISTS `paylog_refund`;
CREATE TABLE `paylog_refund`  (
  `paylog_refund_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `paylog_id` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '支付日志id',
  `refund_sn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '退款单号',
  `paylog_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '操作备注',
  `order_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单编号',
  `refund_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '退款金额',
  `add_time` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '添加时间',
  `admin_id` mediumint(9) NOT NULL DEFAULT 0 COMMENT '操作人员id',
  `pay_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '支付方式code，比如wechat',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '处理状态 0申请中 1成功',
  `notify_time` int(11) NULL DEFAULT 0 COMMENT '通知时间',
  PRIMARY KEY (`paylog_refund_id`) USING BTREE,
  INDEX `paylog_id`(`paylog_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '退款日志表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of paylog_refund
-- ----------------------------

-- ----------------------------
-- Table structure for pc_cat_floor
-- ----------------------------
DROP TABLE IF EXISTS `pc_cat_floor`;
CREATE TABLE `pc_cat_floor`  (
  `cat_floor_id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '分类抽屉id',
  `cat_floor_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '最终显示的分类名',
  `category_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '【JSON】分类ID：[category_id]',
  `category_names` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '【JSON】分类名称：[category_name]',
  `floor_ico` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类ICO图片',
  `hot_cat` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '是否热门分类',
  `is_show` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否显示',
  `sort_order` int(11) UNSIGNED NOT NULL DEFAULT 50 COMMENT '排序',
  `floor_ico_font` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类ICO图标',
  `brand_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '【JSON】推荐的品牌',
  PRIMARY KEY (`cat_floor_id`) USING BTREE,
  INDEX `is_show`(`is_show`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'pc分类楼层' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of pc_cat_floor
-- ----------------------------

-- ----------------------------
-- Table structure for pc_navigation
-- ----------------------------
DROP TABLE IF EXISTS `pc_navigation`;
CREATE TABLE `pc_navigation`  (
  `id` mediumint(8) NOT NULL AUTO_INCREMENT COMMENT '导航配置自增id ',
  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '导航显示标题 ',
  `is_show` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否显示',
  `sort_order` tinyint(1) NOT NULL DEFAULT 0 COMMENT '页面显示顺序，数字越大越靠后',
  `is_blank` tinyint(1) NOT NULL DEFAULT 0 COMMENT '导航链接页面是否在新窗口打开，1，是；其他，否',
  `link` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '[JSON]链接数据{name,label,link,app_link,id,sn……}',
  `type` tinyint(10) NOT NULL DEFAULT 0 COMMENT '1：导航条，2：顶部站点地图导航，3：底部快捷导航',
  `parent_id` int(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '父导航（需具体模板支持）',
  `icon` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '图标',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `is_show`(`is_show`) USING BTREE,
  INDEX `parent_id`(`parent_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 84 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '上中下3个导航栏的显示配置' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of pc_navigation
-- ----------------------------

-- ----------------------------
-- Table structure for points_exchange
-- ----------------------------
DROP TABLE IF EXISTS `points_exchange`;
CREATE TABLE `points_exchange`  (
  `id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `product_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品id',
  `exchange_integral` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '所需积分',
  `points_deducted_amount` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '积分抵扣金额',
  `is_hot` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否热门',
  `is_enabled` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否生效',
  `sku_id` int(11) NULL DEFAULT 0 COMMENT '属性ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `product_id`(`product_id`) USING BTREE,
  INDEX `is_hot`(`is_hot`) USING BTREE,
  INDEX `is_enabled`(`is_enabled`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '积分兑换表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of points_exchange
-- ----------------------------

-- ----------------------------
-- Table structure for price_inquiry
-- ----------------------------
DROP TABLE IF EXISTS `price_inquiry`;
CREATE TABLE `price_inquiry`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `mobile` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '联系电话',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '需求信息',
  `product_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品id',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '回复备注',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '回复状态：0 未回复 1 已回复',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `create_time` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品询价表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of price_inquiry
-- ----------------------------

-- ----------------------------
-- Table structure for product
-- ----------------------------
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product`  (
  `product_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '商品id ',
  `product_name` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品的名称 ',
  `product_sn` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品的唯一货号 ',
  `product_tsn` varchar(255) CHARACTER SET utf8 COLLATE utf8_estonian_ci NULL DEFAULT NULL COMMENT '条形编码',
  `product_stock` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品库存数量 ',
  `product_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '本店售价 ',
  `market_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '市场售价 ',
  `shipping_tpl_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '运费模板id',
  `product_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '该商品状态，1，上架；0，下架',
  `product_type` tinyint(1) NULL DEFAULT 1 COMMENT '商品类型 1普通商品 2虚拟商品3 卡密商品 4 付费内容',
  `category_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品所属商品分类id，取值category的cat_id ',
  `brand_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '品牌id，取值于brand 的brand_id ',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '商品关键字，放在商品页的关键字中，为搜索引擎收录用 ',
  `shop_category_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺分类id',
  `check_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '审核状态:0,待审核;1,审核通过;2,审核未通过',
  `check_reason` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '审核失败原因',
  `click_count` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品点击数',
  `product_weight` decimal(10, 3) UNSIGNED NOT NULL DEFAULT 0.000 COMMENT '商品的重量，以千克为单位 ',
  `is_promote` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否特价促销；0，否；1，是 ',
  `is_promote_activity` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否参加了秒杀',
  `promote_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '促销价格 ',
  `promote_start_date` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '促销价格开始日期 ',
  `promote_end_date` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '促销价格结束日期 ',
  `seckill_max_num` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最大秒杀库存',
  `product_brief` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品的简短描述 ',
  `product_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品的详细描述 ',
  `pic_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品的实际大小图片，如进入该商品页时介绍商品属性所显示的大图片',
  `pic_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品在前台显示的微缩图片，如在分类筛选时显示的小图片 ',
  `pic_original` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '应该是上传的商品的原始图片 ',
  `comment_tag` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标签',
  `free_shipping` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否包邮',
  `integral` int(10) NOT NULL DEFAULT 0 COMMENT '购买该商品可以使用的积分数量，估计应该是用积分代替金额消费；但程序好像还没有实现该功能 ',
  `add_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品的添加时间 ',
  `sort_order` smallint(4) UNSIGNED NOT NULL DEFAULT 100 COMMENT '商品的显示顺序',
  `store_sort_order` smallint(4) UNSIGNED NOT NULL DEFAULT 100 COMMENT '店铺的排序',
  `is_delete` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品是否已经删除，0，否；1，已删除 ',
  `is_best` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否是精品:0，否；1，是 ',
  `is_new` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否是新品:0，否；1，是',
  `is_hot` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否热销:0，否；1，是 ',
  `last_update` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最近一次更新商品配置的时间 ',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品的商家备注，仅商家可见 ',
  `give_integral` int(11) NOT NULL DEFAULT -1 COMMENT '购买该商品时每笔成功交易赠送的积分数量 ',
  `rank_integral` int(11) NOT NULL DEFAULT -1 COMMENT '等级积分',
  `suppliers_id` smallint(5) UNSIGNED NULL DEFAULT NULL COMMENT '供应商id',
  `virtual_sales` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '虚拟销量',
  `limit_number` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '限购数量',
  `product_care` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '温馨提示',
  `product_related` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '[JSON]关联的推荐商品Id',
  `product_service_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '[JSON]服务项ids',
  `is_support_return` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否支持无理由退货',
  `is_support_cod` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否支持货到付款:0,否;1,是',
  `product_video` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品视频',
  `prepay_price` decimal(8, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '预付金额',
  `card_group_id` int(13) NOT NULL DEFAULT 0 COMMENT '关联的电子卡券分组',
  `virtual_sample` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '虚拟商品',
  `paid_content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '付费内容',
  `no_shipping` tinyint(2) NULL DEFAULT 0 COMMENT '是否无需配送0不是1是',
  PRIMARY KEY (`product_id`, `brand_id`, `product_weight`) USING BTREE,
  INDEX `goods_sn`(`product_sn`) USING BTREE,
  INDEX `cat_id`(`category_id`) USING BTREE,
  INDEX `last_update`(`last_update`) USING BTREE,
  INDEX `brand_id`(`brand_id`) USING BTREE,
  INDEX `goods_weight`(`product_weight`) USING BTREE,
  INDEX `promote_end_date`(`promote_end_date`) USING BTREE,
  INDEX `promote_start_date`(`promote_start_date`) USING BTREE,
  INDEX `goods_number`(`product_stock`) USING BTREE,
  INDEX `sort_order`(`sort_order`) USING BTREE,
  INDEX `goods_basesell`(`virtual_sales`) USING BTREE,
  INDEX `store_id`(`shop_id`) USING BTREE,
  INDEX `product_name`(`product_name`) USING BTREE,
  INDEX `keywords`(`keywords`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 347 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of product
-- ----------------------------

-- ----------------------------
-- Table structure for product_article
-- ----------------------------
DROP TABLE IF EXISTS `product_article`;
CREATE TABLE `product_article`  (
  `goods_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品id，取自goods的goods_id ',
  `article_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '否 / 0 	文章id，取自 article 的article_id ',
  PRIMARY KEY (`goods_id`, `article_id`) USING BTREE,
  INDEX `goods_id`(`goods_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '文章关联产品表 ' ROW_FORMAT = DYNAMIC;

