-- ----------------------------
-- Table structure for product_attributes
-- ----------------------------
DROP TABLE IF EXISTS `product_attributes`;
CREATE TABLE `product_attributes`  (
  `attributes_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID号 ',
  `product_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '取值于goods的goods_id ',
  `attr_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '属性类型，0:普通属性，1：规格属性，2：附加规格',
  `attr_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '属性所属类型的名称',
  `attr_value` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '具体属性的值 ',
  `attr_price` decimal(8, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '属性价格 ',
  `attr_color` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '属性颜色',
  `attr_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '属性图片',
  `attr_pic_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '属性缩略图',
  PRIMARY KEY (`attributes_id`) USING BTREE,
  INDEX `goods_id`(`product_id`) USING BTREE,
  INDEX `attr_type`(`attr_type`) USING BTREE,
  INDEX `attr_name`(`attr_name`) USING BTREE,
  INDEX `attr_value`(`attr_value`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5049 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品属性表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of product_attributes
-- ----------------------------

