  `tpl_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '属性模板名称',
  `tpl_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '属性内容',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  PRIMARY KEY (`tpl_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品属性模板表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of product_attributes_tpl
-- ----------------------------

-- ----------------------------
-- Table structure for product_gallery
-- ----------------------------
DROP TABLE IF EXISTS `product_gallery`;
CREATE TABLE `product_gallery`  (
  `pic_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '商品相册ID',
  `product_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '图片属性商品的id ',
  `pic_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '实际图片url ',
  `pic_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '图片说明信息 ',
  `pic_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微缩图片url ',
  `pic_original` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '原图url',
  `pic_large` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '高清图片url ',
  `sort_order` int(8) UNSIGNED NOT NULL DEFAULT 1 COMMENT '排序',
  PRIMARY KEY (`pic_id`) USING BTREE,
  INDEX `goods_id`(`product_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2168 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品相册表' ROW_FORMAT = DYNAMIC;

