-- Records of product_group
-- ----------------------------

-- ----------------------------
-- Table structure for product_inventory_log
-- ----------------------------
DROP TABLE IF EXISTS `product_inventory_log`;
CREATE TABLE `product_inventory_log`  (
  `log_id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NULL DEFAULT 0 COMMENT '商品id',
  `spec_id` int(11) NULL DEFAULT 0 COMMENT '货品ID',
  `number` int(11) NULL DEFAULT 0 COMMENT '剩余库存',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '修改时间',
  `old_number` int(11) NULL DEFAULT 0 COMMENT '原始库存量',
  `type` tinyint(1) NULL DEFAULT 1 COMMENT '1增2减',
  `change_number` int(11) NULL DEFAULT 0 COMMENT '变化量',
  `desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '描述',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  PRIMARY KEY (`log_id`) USING BTREE,
  INDEX `product_id`(`product_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '库存日志' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of product_inventory_log
-- ----------------------------

-- ----------------------------
-- Table structure for product_member_price
-- ----------------------------
DROP TABLE IF EXISTS `product_member_price`;
CREATE TABLE `product_member_price`  (
