  `product_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品的id',
  `user_rank` tinyint(3) NOT NULL DEFAULT 0 COMMENT '会员等级id ',
  `user_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '指定商品对指定会员等级的固定定价价格，单位元',
  PRIMARY KEY (`price_id`) USING BTREE,
  INDEX `goods_id`(`product_id`, `user_rank`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品会员价格' ROW_FORMAT = DYNAMIC;

