-- ----------------------------
-- Table structure for promotion
-- ----------------------------
DROP TABLE IF EXISTS `promotion`;
CREATE TABLE `promotion`  (
  `promotion_id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '活动id',
  `promotion_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '活动名称',
  `start_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '开始时间',
  `end_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '结束时间',
  `type` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '类型1秒杀2优惠券3满减4折扣5满赠6限时折扣',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺ID',
  `relation_id` int(11) NULL DEFAULT 0 COMMENT '活动对应的id',
  `range` tinyint(2) NULL DEFAULT 0 COMMENT '活动范围:0,全部商品;3,指定商品.4，不含以下商品',
  `range_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '[json]活动范围相关信息',
  `sku_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '允许的sku',
  `is_available` tinyint(2) NULL DEFAULT 1 COMMENT '是否启用',
  `is_delete` tinyint(1) NULL DEFAULT 0 COMMENT '是否删除',
  PRIMARY KEY (`promotion_id`) USING BTREE,
  INDEX `start_time`(`start_time`) USING BTREE,
  INDEX `end_time`(`end_time`) USING BTREE,
  INDEX `shop_id`(`shop_id`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `relation_id`(`relation_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '活动表' ROW_FORMAT = DYNAMIC;

