-- ----------------------------
-- Table structure for refund_apply
-- ----------------------------
DROP TABLE IF EXISTS `refund_apply`;
CREATE TABLE `refund_apply`  (
  `refund_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '退款申请id',
  `refund_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1:订单,2:商品',
  `order_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单id',
  `user_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员id',
  `aftersale_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '售后id',
  `refund_status` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0:未处理,1:处理中，2已处理,3:取消',
  `add_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '添加时间',
  `refund_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '回复内容',
  `online_balance` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '线上退款金额',
  `offline_balance` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '线下退款金额',
  `refund_balance` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '退款余额',
  `is_online` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '线上金额是否到账:0 无需处理1处理中 2已处理',
  `is_offline` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '线下金额是否到账:0 无需处理1处理中 2已处理',
  `is_receive` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '余额是否到账:0 无需处理1处理中 2已处理',
  `paylog_refund_id` int(11) NOT NULL DEFAULT 0 COMMENT '线上退款的关联id',
  `shop_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  `payment_voucher` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '打款凭证',
  PRIMARY KEY (`refund_id`) USING BTREE,
  INDEX `refund_type`(`refund_type`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE,
  INDEX `rec_id`(`aftersale_id`) USING BTREE,
  INDEX `refund_status`(`refund_status`) USING BTREE,
  INDEX `aftersale_id`(`aftersale_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '退款申请' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of refund_apply
-- ----------------------------

-- ----------------------------
-- Table structure for refund_log
-- ----------------------------
DROP TABLE IF EXISTS `refund_log`;
CREATE TABLE `refund_log`  (
  `log_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '接口退款日志id',
  `refund_apply_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '来自的退款申请id',
  `refund_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款类型：1：接口原路退回，2：余额退回，3：线下退回',
  `refund_pay_code` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '接口退款时的支付方式code，比如wechat、alipay等',
  `transaction_id` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '接口退款时的支付流水号',
  `refund_amount` decimal(8, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '实际退款金额',
  `add_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款时间',
  `description` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '退款描述',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款会员id',
  `order_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款的订单ID',
  PRIMARY KEY (`log_id`) USING BTREE,
  INDEX `refund_id`(`refund_apply_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '退款申请日志' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of refund_log
-- ----------------------------

