  `seckill_end_time` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '结束时间（此处重复字段是为了提高查询效率）',
  PRIMARY KEY (`rec_id`) USING BTREE,
  INDEX `seckill_id`(`seckill_id`) USING BTREE,
  INDEX `product_id`(`product_id`) USING BTREE,
  INDEX `sku_id`(`sku_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '秒杀活动商品' ROW_FORMAT = DYNAMIC;

