  `shipping_default_id` int(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '默认发货物流公司ID',
  `shipping_type_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '描述',
  `shipping_time_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '发货时间描述',
  `is_support_cod` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否支持货到付款',
  `sort_order` smallint(4) UNSIGNED NOT NULL DEFAULT 50 COMMENT '排序',
