  `amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '提现金额',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态0待审核2审核不通过3完成4待打款',
