-- Table structure for time_discount
-- ----------------------------
DROP TABLE IF EXISTS `time_discount`;
CREATE TABLE `time_discount`  (
  `discount_id` smallint(6) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '活动id',
  `promotion_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '活动名称',
  `start_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '开始时间',
  `end_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '结束时间',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺ID',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '创建时间',
  PRIMARY KEY (`discount_id`) USING BTREE,
  INDEX `shop_id`(`shop_id`) USING BTREE,
  INDEX `start_time`(`start_time`) USING BTREE,
  INDEX `end_time`(`end_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '限时折扣' ROW_FORMAT = DYNAMIC;

