-- ----------------------------
-- Table structure for time_discount_item
-- ----------------------------
DROP TABLE IF EXISTS `time_discount_item`;
CREATE TABLE `time_discount_item`  (
  `item_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '规格ID',
