-- ----------------------------
-- Table structure for translations
-- ----------------------------
DROP TABLE IF EXISTS `translations`;
CREATE TABLE `translations`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `translation_name` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '待翻译标识',
  `translation_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '根据name生成的md5',
  `data_type` tinyint(2) NULL DEFAULT 0 COMMENT '0 页面，1 接口',
  `shop_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '应用翻译维护表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of translations
-- ----------------------------

-- ----------------------------
-- Table structure for translations_data
-- ----------------------------
DROP TABLE IF EXISTS `translations_data`;
CREATE TABLE `translations_data`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `locale_id` int(11) NULL DEFAULT NULL,
  `translation_name` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '待翻译内容',
  `translation_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '根据name生成的md5',
  `translation_value` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '翻译后的值',
  `data_type` tinyint(2) NULL DEFAULT 0 COMMENT '据类型，0：页面，1：接口，2：商品，3：分类，4：品牌, 5: 设置，6:文章标题',
  `data_id` int(11) NULL DEFAULT NULL COMMENT '数据ID，如商品ID，分类ID，品牌ID，导航菜单ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `locale_id`(`locale_id`) USING BTREE,
  INDEX `data_id`(`data_id`) USING BTREE,
  INDEX `data_type`(`data_type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '数据翻译维护表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of translations_data
-- ----------------------------

-- ----------------------------
-- Table structure for unipush_log
