  `send_user_type` tinyint(1) NULL DEFAULT 0 COMMENT '消息发送类型',
  PRIMARY KEY (`unipush_log_id`) USING BTREE,
  INDEX `add_time`(`add_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'unipush推送日志' ROW_FORMAT = DYNAMIC;

