-- Records of unipush_log
-- ----------------------------

-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user`  (
  `user_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '会员资料自增id ',
  `username` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户名',
  `avatar` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '头像',
  `mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `mobile_validated` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '手机号是否已验证',
  `email` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员邮箱',
  `email_validated` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '邮箱是否已验证',
  `nickname` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '昵称',
  `password` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户密码',
  `birthday` date NULL  COMMENT '出生日期',
  `balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '用户现有余额',
  `frozen_balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '用户冻结余额',
  `points` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '积分',
  `growth_points` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '成长值',
  `address_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '当前会员地址',
  `reg_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '注册时间',
  `last_login` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最后一次登录时间',
  `last_ip` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '最后一次登录IP',
  `rank_id` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员等级id',
  `referrer_user_id` mediumint(9) NOT NULL DEFAULT 0 COMMENT '推荐人会员id',
  `from_tag` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '公众号1,小程序2,H5,PC4,APP5',
  `is_svip` tinyint(1) NULL DEFAULT 0 COMMENT '是否是超级会员 1是 0不是 2过期',
  `svip_expire_time` int(11) NULL DEFAULT 0 COMMENT '会员过期时间',
  `order_count` mediumint(9) NOT NULL DEFAULT 0 COMMENT '累积消费次数',
  `order_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '累积消费金额',
  `history_product_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '【JSON】历史浏览记录id：number[]',
  `is_distribution` tinyint(1) NULL DEFAULT 0 COMMENT '是否是分销员（已弃用）',
  `distribution_register_time` int(11) NULL DEFAULT 0 COMMENT '分销员注册时间（已弃用）',
  `wechat_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微信二维码图片',
  `is_company_auth` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否企业认证：1 是 0 否',
  PRIMARY KEY (`user_id`) USING BTREE,
  UNIQUE INDEX `username`(`username`) USING BTREE,
  INDEX `email`(`email`) USING BTREE,
  INDEX `parent_id`(`referrer_user_id`) USING BTREE,
  INDEX `is_distribution`(`is_distribution`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for user_address
-- ----------------------------
DROP TABLE IF EXISTS `user_address`;
CREATE TABLE `user_address`  (
  `address_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `address_tag` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货地址别名',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `consignee` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人的名字',
  `email` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '收货人的email',
  `region_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '[JSON]收货地址id:number[]',
  `region_names` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '[JSON]地区名称:string[]',
  `address` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人的详细地址',
  `postcode` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '收货人的邮编',
  `telephone` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '收货人的电话',
  `mobile` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人的手机号',
  `is_default` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否默认',
