-- ----------------------------
-- Table structure for user_authorize
-- ----------------------------
DROP TABLE IF EXISTS `user_authorize`;
CREATE TABLE `user_authorize`  (
  `authorize_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '会员登录绑定',
  `authorize_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '绑定平台：1:微信，2:小程序',
  `user_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `open_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'openid',
