  `open_photo` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户头像',
  `unionid` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '微信开放平台唯一识别码',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '授权时间（留作登录时效）',
  PRIMARY KEY (`authorize_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `authorize_type`(`authorize_type`) USING BTREE,
  INDEX `open_id`(`open_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户第三方授权信息' ROW_FORMAT = DYNAMIC;

