DROP TABLE IF EXISTS `user_invoice`;
CREATE TABLE `user_invoice`  (
  `invoice_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '会员发票信息id',
  `user_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员id',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专用发票审核状态：0：未申请专用发票，1：审核通过，2：已申请，待审核，3：审核未通过',
  `apply_reply` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '审核失败时的回复内容',
  `add_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '添加时间',
  `title_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '抬头：1：个人，2企业',
  `company_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '单位名称',
  `company_code` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '纳税人识别号',
  `company_address` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '单位地址',
  `company_phone` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '单位电话',
  `company_bank` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '开户银行',
  `company_account` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '开户账号',
  `mobile` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邮箱',
  `invoice_content` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '商品明细' COMMENT '发票内容，统一为商品明细',
  PRIMARY KEY (`invoice_id`) USING BTREE,
  INDEX `user_id`(`user_id`, `status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户发票' ROW_FORMAT = DYNAMIC;

