  `add_time` int(11) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`message_id`) USING BTREE,
  INDEX `message_log_id`(`message_log_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户站内信' ROW_FORMAT = DYNAMIC;

