  `message_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '消息类型',
  `send_user_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '发送类型',
  `user_ids` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户集合',
  `user_rank` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员等级',
