  `is_recall` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否撤回',
  PRIMARY KEY (`message_log_id`) USING BTREE,
  INDEX `send_user_type`(`send_user_type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '站内信' ROW_FORMAT = DYNAMIC;

