-- ----------------------------
-- Table structure for user_rank
-- ----------------------------
DROP TABLE IF EXISTS `user_rank`;
CREATE TABLE `user_rank`  (
  `rank_id` tinyint(3) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '会员等级编号',
  `rank_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员等级名称',
  `min_growth_points` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '该等级的最低成长值（升级条件）',
  `max_growth_points` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '该等级的最高成长值（已弃用）',
  `discount` decimal(4, 1) UNSIGNED NOT NULL DEFAULT 0.0 COMMENT '该会员等级的商品折扣',
  `show_price` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否显示商品价格（已弃用）',
  `rank_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '等级类型：1：根据成长值变化，2：根据消费行为',
  `rank_logo` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员图标',
  `rank_ico` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员等级图标',
  `rank_bg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员等级背景图（移动端）',
  `rank_point` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '权益积分',
  `free_shipping` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否包邮：1 是 0 否',
  `rank_card_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '会员卡类型：1 背景色 2自定义图片',
  `rights` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '自定义权益【json】',
  `rank_level` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员等级',
  PRIMARY KEY (`rank_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员等级配置信息' ROW_FORMAT = DYNAMIC;

