-- ----------------------------
-- Table structure for user_type
-- ----------------------------
DROP TABLE IF EXISTS `user_type`;
CREATE TABLE `user_type`  (
  `user_type_id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_type_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '权益名称',
  `period` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '有效期',
  `original_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '原价',
  `favourable_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '优惠价',
  `sort_order` smallint(4) UNSIGNED NOT NULL DEFAULT 50 COMMENT '排序',
  `is_on` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否开启',
  PRIMARY KEY (`user_type_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 7 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员权益表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of user_type
-- ----------------------------

-- ----------------------------
-- Table structure for user_type_account
-- ----------------------------
DROP TABLE IF EXISTS `user_type_account`;
CREATE TABLE `user_type_account`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NULL DEFAULT 0 COMMENT '用户id',
  `user_type_id` int(11) NULL DEFAULT 0 COMMENT '会员类型id',
  `amount` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '支付金额',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '支付状态 0待支付 2已支付',
  `pay_time` int(11) NULL DEFAULT 0 COMMENT '支付时间',
  `desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '描述',
  `add_time` int(11) NULL DEFAULT 0 COMMENT '下单时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员权益购买记录' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of user_type_account
-- ----------------------------

-- ----------------------------
-- Table structure for user_withdraw_account
-- ----------------------------
DROP TABLE IF EXISTS `user_withdraw_account`;
CREATE TABLE `user_withdraw_account`  (
  `account_id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '提现账号',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `account_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '提现账号类型，1：银行卡，2：支付宝，3：微信',
  `account_name` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '姓名',
  `account_no` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '银行卡号或账号',
  `identity` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '身份证号',
  `bank_name` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行名称',
  PRIMARY KEY (`account_id`) USING BTREE,
  INDEX `card_type`(`account_type`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员提现账号' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of user_withdraw_account
-- ----------------------------

-- ----------------------------
-- Table structure for user_withdraw_apply
-- ----------------------------
DROP TABLE IF EXISTS `user_withdraw_apply`;
CREATE TABLE `user_withdraw_apply`  (
  `id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '提现申请id',
  `user_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '申请提现的金额',
  `add_time` int(10) NOT NULL DEFAULT 0 COMMENT '记录插入时间',
  `finished_time` int(10) NOT NULL DEFAULT 0 COMMENT '完成时间',
  `postscript` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '管理员的备注',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '处理状态，0：待处理，1：已完成，2：拒绝申请',
  `account_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '[JSON]提现人卡号等信息',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `is_paid`(`status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户提现申请表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of user_withdraw_apply
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_live
-- ----------------------------
DROP TABLE IF EXISTS `wechat_live`;
CREATE TABLE `wechat_live`  (
  `wechat_live_id` int(11) NOT NULL AUTO_INCREMENT,
  `wechat_live_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '直播标题',
  `wechat_live_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '直播内容',
  `act_range` tinyint(3) NOT NULL DEFAULT 0 COMMENT '活动范围',
  `act_range_ext` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '活动简介',
  `room_id` int(9) UNSIGNED NOT NULL DEFAULT 0 COMMENT '房间号',
  `share_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分享图',
  `cover_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '封面图',
  `anchor_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '主持人姓名',
  `anchor_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '主持人图片',
  `live_status` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '直播状态',
  `start_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '开始时间',
  `end_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '结束时间',
  `last_update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最后一次更新时间',
  `product_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '产品数据',
  `thumb_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '缩略图',
  `live_sn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '直播编码',
  `shop_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺id',
  PRIMARY KEY (`wechat_live_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '小程序直播' ROW_FORMAT = DYNAMIC;

